import { Grid, TextField } from "@mui/material";
import Form from "../components/Form";

export const Institute = () => {
  return (
    <>
      <Form title="Instituto">
        <Grid container spacing={2}>
          <Grid item xs={6}>
              <TextField label="Instituto"/>
          </Grid>
        </Grid>
      </Form>
    </>
  );
};

export default Institute;
